import React from 'react';
import './home.css';

// Functional component example
function Home() {
    return(
        <div className='parent'>
        <center><h1> Data entry forms </h1></center>
        <div className='button-container'>
        <button className="button">Emp_TC</button>
        <button className="button">Emp_TC_OPT</button>
        <button className="button">Emp_master</button>
        <button className="button">STUDENT_MASTER</button>
        </div>
        </div>
    );
}

export default Home;
